import React from "react";
import "./productlistadmin.css";
import { DataGrid } from "@material-ui/data-grid";

export default function ProductListAdmin() {
  const columns = [
    {
      field: "productId",
      headerName: "Product ID",
      width: 150,
      editable: true,
    },
    {
      field: "name",
      headerName: "Name",
      width: 150,
      editable: true,
    },
    {
      field: "price",
      headerName: "Price",
      type: "number",
      width: 120,
      editable: true,
    },
    {
      field: "title",
      headerName: "Title",
      width: 200,
      editable: true,
    },
    {
      field: "description",
      headerName: "Description",
      description: "This column has a value getter and is not sortable.",
      sortable: false,
      width: 160,
    },
    {
      field: "author",
      headerName: "Author",
      description: "This column has a value getter and is not sortable.",
      sortable: false,
      width: 160,
    },
    {
      field: "publisher",
      headerName: "Publisher",
      description: "This column has a value getter and is not sortable.",
      sortable: false,
      width: 160,
    },
    {
      field: "stock",
      headerName: "Stock",
      description: "This column has a value getter and is not sortable.",
      sortable: false,
      width: 160,
    },
    {
      field: "img",
      headerName: "Img",
      description: "This column has a value getter and is not sortable.",
      sortable: false,
      width: 160,
      renderCell: (params) => {
        return (
          <div className="productListItem">
            <img className="userListImg" src={params.row.img} alt="" />
          </div>
        );
      },
    },
  ];

  const rows = [
    {
      id: 1,
      productId: "chuanluu0103",
      name: "Snow",
      price: "Jon",
      title: 35,
      description: "hihi",
      author: "Kaabrba",
      publisher: "Kim dong",
      stock: "50",
      img: "https://res.cloudinary.com/chuanluu/image/upload/v1631270698/test/wzke4wclpbnobk55odcw.jpg",
    },
    {
      id: 2,
      productId: "chuanluu0103",
      name: "Snow",
      price: "Jon",
      title: 35,
      description: (
        <div>
          <img
            src="https://res.cloudinary.com/chuanluu/image/upload/v1631270698/test/wzke4wclpbnobk55odcw.jpg"
            alt=""
          />
        </div>
      ),
      author: "Kaabrba",
      publisher: "Kim dong",
      stock: "50",
    },
    {
      id: 3,
      productId: "chuanluu0103",
      name: "Snow",
      price: "Jon",
      title: 35,
      description: (
        <div>
          <img
            src="https://res.cloudinary.com/chuanluu/image/upload/v1631270698/test/wzke4wclpbnobk55odcw.jpg"
            alt=""
          />
        </div>
      ),
      author: "Kaabrba",
      publisher: "Kim dong",
      stock: "50",
    },
  ];
  return (
    <div style={{ height: 400, width: "100%" }}>
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        checkboxSelection
        disableSelectionOnClick
      />
    </div>
  );
}
